/*
慢手超速版  安卓&ios 自己搜索下载
变量：ksurl   需要一个登录salt和xxxx.api_st(就是以前的cookie，但是不要前面的参数名，只要值)，ios和安卓都可以抓到，自己搜索salt。
salt可能在请求的url里面，或者返回体里面（ios应该就是返回体里面）6.4后需要一个did的值
格式 两个值用 & 拼接 例：salt&cookie 如 38dsdsdsdasdasd&c778sdsssfsafasf5454sdfasd7asd5asd5as4d54asd4as5&ANDROID_xxxxxxx
多账号@分割
变量 kscdkey    对应脚本验证卡密。所有脚本通用
一天能龟速跑个7-9。列表提现。
一天运行10次
6.4更新，修复宝箱-看广告-看直播-逛街-开宝箱-宝箱翻倍金币太少的问题
增加ksurl变量值did
增加自定义提现开关变量 kstxkg  为1自动按列表提现，为0不自动提现  
现格式如下：salt&cookie&did@salt2&cookie2&did2
6.6更新加入随机排队等待，大量减少了undefined的问题。
*/
